import React from "react";
import styled from "styled-components";
import {Link} from "react-router-dom";
import Icon from "../components/Icon";

const Container = styled.div`
  height: 100%;
  width: 100%;
  display: flex;
  >a{
    width: 50px;
    height: 50px;
    >Icon{
      width: 50px;
      height: 50px;
    }
  }
`
function tagsSettings(){
    return (
        <Container>
            <Link to='/count'>
                <Icon name='home'></Icon>
            </Link>
        </Container>
    )
}
export default  tagsSettings;
